import '../styles/Home.css';

import React, {Component} from 'react';
import {connect} from 'react-redux';
import {Grid} from '@material-ui/core';

import Sidebar from './Sidebar';

class Home extends Component{
    constructor(props){
        super(props);
    }

    componentDidMount(){
        console.log('CURRENT INDEX: ', this.props.currentIndex);
    }

    render(){
        return <Grid className = {'home-container'} container spacing ={0}>
            <Grid className = {'sidebar-container'} item xs={3}><Sidebar/></Grid>
            <Grid item xs={9}></Grid>
        </Grid>
    }
}

const mapStateToProp = state => {
    return {
        currentIndex : state.sidebarReducer.currentIndex
    }
}

export default connect(mapStateToProp, {})(Home);
